import React from 'react'
import { Particles } from "react-particles-js";
import './app.css'
import 'bootstrap/dist/css/bootstrap.min.css'

export default function HomeBAW(props) {
    return (
        <div className="homeBAW" id="home">
            <Particles 
            params={{
                "particles": {
                    "number": {
                        "value": 700
                    },
                    "size": {
                        "value": 3,
                        "random": true
                    },
                    "color": {
                        "value":"#000000"
                    },
                    "line_linked": {
                        "enable": true,
                        "opacity": 1,
                        "color": "#474747",
                        "width": 1
                    },
                    "move": {
                        "enable": true,
                        "straight": false,

                    }
                },
                "interactivity": {
                    "events": {
                        "onhover": {
                            "enable": true,
                            "mode": "grab"
                        }
                    }
                }
            }} />
        </div>
    )
}
